import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <p>
        © 2020 Airbnb React Rebuild. No rights reserved - for demo purposes
        only!
      </p>
      <p>Privacy · Terms · Sitemap · Company Details</p>
    </div>
  );
}

export default Footer;
